import React from 'react';
import NotFound from '../Assets/page-not-found.png';
const PageNotFound = () => {
    return (
        <div>
            <h1>404</h1>
            <p></p>
            <img src={NotFound} alt="page not found" style={{width: '100vw', height: '100vh'}}/>
        </div>
    );
};

export default PageNotFound;
